let images = [];

window.addEventListener('load', function () {
	viewSlide();
});

function viewSlide() {
  const slideContainer = document.getElementById("slide-container");

  images = images_all.slice();
 
  let topIndex = Math.floor(Math.random() * images.length);
  let topImage = images[topIndex];
  images.splice(topIndex, 1);

  let backIndex = Math.floor(Math.random() * images.length);
  let backImage = images[backIndex];
  images.splice(backIndex, 1)

  slideContainer.innerHTML =  "" + 
  "<div class='image-container'>" + 
    "<img src='" + backImage[0] + "'>" + 
    "<a href='" + backImage[1] + "' target='_blank'>" + 
      "<div class='url'>" + backImage[1] + "</div>" + 
    "</a>" +
  "</div>" +
  "<div class='image-container' id='top'>" + 
    "<img src='" + topImage[0] + "'>" +
    "<a href='" + topImage[1] + "' target='_blank'>" +
      "<div class='url'>" + topImage[1] + "</div>" + 
    "</a>" + 
  "</div>";

  setInterval(() => {
    topImage = backImage;  
    backIndex = Math.floor(Math.random() * images.length);
    backImage = images[backIndex];
    images.splice(backIndex, 1)
    if (images.length == 0) {
      images = images_all.slice();
    }

    slideChange (slideContainer, topImage, backImage);
  }, 10000);
}

function slideChange (slideContainer, topImage, backImage) {
  let top = document.getElementById("top")
  top.classList.add("hide");
  setTimeout(() => {
    slideContainer.innerHTML =  "" + 
    "<div class='image-container'>" + 
      "<img src='" + backImage[0] + "'>" + 
      "<a href='" + backImage[1] + "' target='_blank'>" + 
        "<div class='url'>" + backImage[1] + "</div>" + 
      "</a>" +
    "</div>" +
    "<div class='image-container' id='top'>" + 
      "<img src='" + topImage[0] + "'>" +
      "<a href='" + topImage[1] + "' target='_blank'>" +
        "<div class='url'>" + topImage[1] + "</div>" + 
      "</a>" + 
    "</div>";  
  }, 3000);
}